import React, { useState } from 'react';
import {
  AppBar,
  Box,
  Toolbar,
  IconButton,
  Typography,
  Menu,
  Container,
  Button,
  MenuItem,
  Drawer,
  List,
  ListItem,
  ListItemText,
  useTheme,
  useMediaQuery,
  Stack,
} from '@mui/material';
import MenuIcon from '@mui/icons-material/Menu';
import { Link as RouterLink } from 'react-router-dom';
import PhoneIcon from '@mui/icons-material/Phone';
import EmailIcon from '@mui/icons-material/Email';
import LocationOnIcon from '@mui/icons-material/LocationOn';

const pages = [
  {
    title: 'Programmes',
    path: '/programmes',
    subMenu: [
      { title: 'UG Programmes', path: '/programmes#ug' },
      { title: 'PG Programmes', path: '/programmes#pg' },
      { title: 'Doctorate Programmes', path: '/programmes#phd' },
    ]
  },
  {
    title: 'About',
    path: '/about',
    subMenu: [
      { title: 'Overview', path: '/about' },
      { title: 'Vision & Mission', path: '/about#vision' },
      { title: 'Milestones', path: '/about#milestones' },
    ]
  },
  {
    title: 'Academics',
    path: '/academics',
    subMenu: [
      { title: 'Departments', path: '/departments' },
      { title: 'Academic Calendar', path: '/academic-calendar' },
      { title: 'Examinations', path: '/examinations' },
    ]
  },
  {
    title: 'Research',
    path: '/research',
    subMenu: [
      { title: 'Research Centers', path: '/research#centers' },
      { title: 'Publications', path: '/research#publications' },
      { title: 'Projects', path: '/research#projects' },
    ]
  },
  {
    title: 'Innovation',
    path: '/innovation',
    subMenu: [
      { title: 'Innovation Hub', path: '/innovation#hub' },
      { title: 'Startups', path: '/innovation#startups' },
      { title: 'Patents', path: '/innovation#patents' },
    ]
  },
  {
    title: 'International',
    path: '/international',
    subMenu: [
      { title: 'Partnerships', path: '/international#partnerships' },
      { title: 'Exchange Programs', path: '/international#exchange' },
      { title: 'Global Events', path: '/international#events' },
    ]
  },
  {
    title: 'Campus Life',
    path: '/campus-life',
    subMenu: [
      { title: 'Facilities', path: '/campus-life#facilities' },
      { title: 'Clubs', path: '/campus-life#clubs' },
      { title: 'Events', path: '/campus-life#events' },
    ]
  },
  {
    title: 'Placements',
    path: '/placements',
    subMenu: [
      { title: 'Overview', path: '/placements' },
      { title: 'Statistics', path: '/placements#statistics' },
      { title: 'Recruiters', path: '/placements#recruiters' },
    ]
  },
];

const Navbar = () => {
  const [anchorElNav, setAnchorElNav] = useState(null);
  const [menuAnchors, setMenuAnchors] = useState({});
  const theme = useTheme();
  const isMobile = useMediaQuery(theme.breakpoints.down('md'));

  const handleOpenNavMenu = (event) => {
    setAnchorElNav(event.currentTarget);
  };

  const handleCloseNavMenu = () => {
    setAnchorElNav(null);
  };

  const handleOpenMenu = (event, index) => {
    setMenuAnchors({ ...menuAnchors, [index]: event.currentTarget });
  };

  const handleCloseMenu = (index) => {
    setMenuAnchors({ ...menuAnchors, [index]: null });
  };

  return (
    <>
      {/* Top Bar */}
      <Box sx={{ bgcolor: 'primary.dark', color: 'white', py: 1 }}>
        <Container>
          <Stack 
            direction={{ xs: 'column', sm: 'row' }} 
            spacing={{ xs: 1, sm: 3 }}
            alignItems="center"
            justifyContent="space-between"
          >
            <Stack direction="row" spacing={3}>
              <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                <PhoneIcon fontSize="small" />
                <Typography variant="body2">+91 4259 200300</Typography>
              </Box>
              <Box sx={{ display: 'flex', alignItems: 'center', gap: 1 }}>
                <EmailIcon fontSize="small" />
                <Typography variant="body2">info@sece.ac.in</Typography>
              </Box>
            </Stack>
            <Stack direction="row" spacing={2}>
              <Button 
                component={RouterLink} 
                to="/nirf"
                size="small"
                sx={{ color: 'white', '&:hover': { color: 'grey.300' } }}
              >
                NIRF
              </Button>
              <Button 
                component={RouterLink} 
                to="/naac"
                size="small"
                sx={{ color: 'white', '&:hover': { color: 'grey.300' } }}
              >
                NAAC
              </Button>
              <Button 
                component={RouterLink} 
                to="/contact"
                size="small"
                sx={{ color: 'white', '&:hover': { color: 'grey.300' } }}
              >
                Contact
              </Button>
            </Stack>
          </Stack>
        </Container>
      </Box>

      <AppBar position="sticky" sx={{ bgcolor: 'white', boxShadow: 1 }}>
        <Container maxWidth="xl">
          <Toolbar disableGutters>
            {/* Logo */}
            <Typography
              variant="h6"
              noWrap
              component={RouterLink}
              to="/"
              sx={{
                mr: 2,
                display: { xs: 'none', md: 'flex' },
                fontWeight: 700,
                color: 'primary.main',
                textDecoration: 'none',
              }}
            >
              SECE
            </Typography>

            {/* Mobile Menu */}
            <Box sx={{ flexGrow: 1, display: { xs: 'flex', md: 'none' } }}>
              <IconButton
                size="large"
                aria-label="menu"
                aria-controls="menu-appbar"
                aria-haspopup="true"
                onClick={handleOpenNavMenu}
                color="primary"
              >
                <MenuIcon />
              </IconButton>
              <Menu
                id="menu-appbar"
                anchorEl={anchorElNav}
                anchorOrigin={{
                  vertical: 'bottom',
                  horizontal: 'left',
                }}
                keepMounted
                transformOrigin={{
                  vertical: 'top',
                  horizontal: 'left',
                }}
                open={Boolean(anchorElNav)}
                onClose={handleCloseNavMenu}
                sx={{
                  display: { xs: 'block', md: 'none' },
                }}
              >
                {pages.map((page) => (
                  <MenuItem 
                    key={page.title} 
                    component={RouterLink} 
                    to={page.path}
                    onClick={handleCloseNavMenu}
                  >
                    <Typography textAlign="center">{page.title}</Typography>
                  </MenuItem>
                ))}
              </Menu>
            </Box>

            {/* Desktop Menu */}
            <Box sx={{ flexGrow: 1, display: { xs: 'none', md: 'flex' }, justifyContent: 'flex-end' }}>
              {pages.map((page, index) => (
                <Box key={page.title}>
                  <Button
                    onClick={(e) => handleOpenMenu(e, index)}
                    sx={{ 
                      my: 2, 
                      color: 'primary.main', 
                      display: 'block',
                      '&:hover': {
                        backgroundColor: 'primary.light',
                        color: 'white',
                      }
                    }}
                  >
                    {page.title}
                  </Button>
                  <Menu
                    anchorEl={menuAnchors[index]}
                    open={Boolean(menuAnchors[index])}
                    onClose={() => handleCloseMenu(index)}
                    MenuListProps={{
                      'aria-labelledby': 'basic-button',
                    }}
                  >
                    {page.subMenu.map((item) => (
                      <MenuItem
                        key={item.title}
                        component={RouterLink}
                        to={item.path}
                        onClick={() => handleCloseMenu(index)}
                      >
                        {item.title}
                      </MenuItem>
                    ))}
                  </Menu>
                </Box>
              ))}
              <Button
                variant="contained"
                component={RouterLink}
                to="/admissions"
                sx={{ 
                  ml: 2,
                  my: 2,
                  bgcolor: 'secondary.main',
                  '&:hover': {
                    bgcolor: 'secondary.dark',
                  }
                }}
              >
                Admissions 2024
              </Button>
            </Box>
          </Toolbar>
        </Container>
      </AppBar>
    </>
  );
};

export default Navbar;
